import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
  { id: "e1", title: "Some event" },
  { id: "e1", title: "Another event" },
];

function EventsPage() {
  return (
    <>
      <h1>EventsPage</h1>;
      <ul>
        {DUMMY_EVENTS.map((events) => (
          <li key={events.id}>{events.title}</li>
        ))}
      </ul>
    </>
  );
}

export default EventsPage;
